\f0\i\fs30 \cf2 \expnd0\expndtw0\kerning0
We've already proposed that we think users will want to search on Name, Country and City. I was thinking that most (people's) Names are not names of Countries or Cities, and most Countries are not names of Cities. Therefore, in most cases, there's no overlap (I realise there is in the action depicted above, but entering one more character, an "i", would probably have sorted that - not that two search results represents a big list to choose the right result from). However - if there is overlap, then weighting the results in order of Name matches first, followed by Country matches next, then City matches last, would put the most important matches at the top and least important matches at the bottom. I'm playing Devil's Advocate here somewhat, but think there's merit in this approach.}

