You'll notice I've not shown the SSM in this screenshot. This is inconsistent with screen 2.3, but I've deliberately done this to ask the question which is also asked above; should the SSM be hidden until you select a Contact - which is an indication you want to do something with the Contact? Until then, this view/screen serves as a dashboard for your Contacts, displaying useful information about them, their availability etc - doesn't it therefore make sense to maximise the number of Contacts which can be displayed by removing screen elements which are not required? Is the SSM such a screen element?}

