\f0\i\fs30 \cf2 \expnd0\expndtw0\kerning0
Scrolling through the list to find a Contact is the most basic form of searching, but definitely the simplest and often probably also the fastest when there are no more than a couple of "screens worth" of Contacts. I think scrolling and "scanning" is such a common behaviour on almost every computing device, mobile and desktop, that people are very used to it, comfortable with it, and actually also quite good at it. Key to helping users to "scan" effectively will be our visual design of the list, making the Contact Name visually identifiable - "scannable" (in a word) using size, colour, proximity etc.}

{\rtf1\ansi\ansicpg1252\cocoartf1187\cocoasubrtf340
