\f0\i\fs36 \cf2 \expnd0\expndtw0\kerning0
Another point we've yet to agree on, but something which I've always felt was an important part of the app concept from the outset, was the idea of the "Me" Contact. The "Me" Contact represents the User themselves, i.e. their Timezone. It's analogous to the "You are here" marker on maps in shopping malls and tourist attractions, or the marker on a GPS device which represents the device's current location. I think the "Me" Contact performs the same role - it orients the User, not to a location, but to a time - to the "when", related to the people (Contacts) which User cares about.}

