Finding a particular Contact so that something can be done with that Contact is a Task which Users will perform with high frequency. Since the focus of our app from its very inception has been all about "People", we had better make it quick and easy for a User to find a Contact.}

{\rtf1\ansi\ansicpg1252\cocoartf1187\cocoasubrtf340
\cocoascreenfonts1{\fonttbl\f0\fnil\fcharset0 Miso;}
